void cb_status_and_stop_reason(dyn_string dpe, dyn_anytype val){
  txt_sts_post.text(stsToText(val[1]));
  txt_stop_reason.text(stpToText(val[2]));
}


main(){
  string type;
  int type_int;
  dpGet(DP + &quot;.Type_NP&quot;, type_int);
   switch(type_int){
    case 0:
      type = &quot;АИ-92&quot;;
      break;
    case 1:
      type = &quot;АИ-95&quot;;
      break;
    case 2:
      type = &quot;АИ-98&quot;;
      break;
    case 3:
      type = &quot;АИ-100&quot;;
      break;
    case 4:
      type = &quot;ДТ&quot;;
      break;
    default:
      type = &quot;---&quot;;
  }
  txt_type_np.text(type);

  dpConnect(&quot;cb_status_and_stop_reason&quot;, DP + &quot;.sStatusPosta&quot;,
                                         DP + &quot;.sStatusStop&quot;);
}

